// src/components/Main.js
// main component

import React from 'react';
import '../assets/styles/main.css';

function Main() {
    // return the title page
    return (
        <main className="main-title-container">
            <div className='main-title'>
                <h1>HI</h1>
                <h1>IT'S ME, LIN</h1>
            </div>
        </main>
    );
}

export default Main;
